        .img-shoes {top:21.2rem;left:9rem;width:8.2rem;transform:scale(0);animation-name:scale_shoes, shoes;animation-fill-mode:forwards;animation-duration:.8s, .5s;animation-timing-function:cubic-bezier(0.34, 1.56, 0.64, 1), ease-in-out;animation-delay:1.2s, 2s;animation-iteration-count:1, infinite;animation-direction:normal, alternate-reverse;transform-origin:50% 50%;}
        .img-meta {top:21rem;left:13.8rem;width:13rem;z-index:-1;transform:scale(0);animation:scale .8s forwards cubic-bezier(0.34, 1.56, 0.64, 1);animation-delay:1.4s;transform-origin:25% 100%;}
        footer {display:flex;flex-direction:column;align-items:center;height:130px;text-align:center;}
        .img-word {width:28.7rem;}
        .img-logo {width:6.9rem;margin-top:1rem;}

        @media (max-width: 340px) {
            .meta-content {transform:translateX(-60%);}
        }
        @keyframes scale {
            0% {transform:scale(0);}
            100% {transform:scale(1);}
        }
        @keyframes scale_ing {
            0% {transform:scale(1);}
            75% {transform:scale(.95);}
            100% {transform:scale(.95);}
        }
        @keyframes inf {
            0% {transform:translateY(10%);}
            100% {transform:translateY(0);}
        }
        @keyframes scale_shoes {
            0% {transform:scale(0);}
            100% {transform:scale(1);}
        }
        @keyframes shoes {
            0% {transform:rotate(-45deg);}
            100% {transform:rotate(0);}
        }
    </style>
</head>
